package com.leet.minimumwindowsubstring;


import java.util.HashMap;
import java.util.Map;

public class Solution {

    /**
     * Given a string S and a string T, find the minimum window in S which will contain all the characters in T in complexity O(n).
     * <p>
     * Example:
     * <p>
     * Input: S = "ADOBECODEBANC", T = "ABC"
     * Output: "BANC"
     * Note:
     * <p>
     * If there is no such window in S that covers all characters in T, return the empty string "".
     * If there is such window, you are guaranteed that there will always be only one unique minimum window in S.
     * <p>
     * Will the string only contain uppercase characters?
     * Will substring t have repeat characters
     * <p>
     * Sliding Window
     */
    public String minWindow_longSringTimeout(String s, String t) {

        Map<Character, Integer> subCount = new HashMap<>();
        for (char c : t.toCharArray()) {
            int count = subCount.getOrDefault(c, 0);
            subCount.put(c, ++count);
        }

        int left = 0;
        int right = t.length() ;

        int min = 0;
        String minSubstring = "";

        while (left >= 0 && left <= s.length() - t.length() && right >= t.length() - 1 && right <= s.length()) {
            String substr = s.substring(left, right);

            boolean moveRight = false;

            Map<Character, Integer> charCount = new HashMap<>();
            for (char c : substr.toCharArray()) {
                if (subCount.keySet().contains(c)) {
                    int count = charCount.getOrDefault(c, 0);
                    charCount.put(c, ++count);
                }
            }

            for (char c : subCount.keySet()){
                if (charCount.getOrDefault(c, 0) < subCount.get(c)){
                    moveRight = true;
                    break;
                }
            }
            if (moveRight){
                right++;
            }else {
                if (minSubstring.length() == 0 || minSubstring.length() > substr.length())    {
                    minSubstring = substr;
                }
                left++;
            }


        }


        return minSubstring;

    }

    public String minWindow(String s, String t) {
        int[] charArray = new int[128];

        for (char c : t.toCharArray())
            charArray[c]++;

        int count = t.length(), begin = 0, end = 0, d = Integer.MAX_VALUE, head = 0;

        while (end < s.length()) {
            if (charArray[s.charAt(end)] > 0){
                count--;
            }
            charArray[s.charAt(end)]--;
            end++;
            while (count == 0) {
                if (end - begin < d) {
                    d = end - begin;
                    head = begin;
                }
                if (charArray[s.charAt(begin)] == 0)
                    count++;
                charArray[s.charAt(begin)]++;
                begin++;
            }
        }

        return d == Integer.MAX_VALUE ? "" : s.substring(head, head + d);

    }

    public String minWindow2(String s, String t) {
        int[] charArray = new int[256]; //to hold all ascii characters;
        int unmatchedCount = t.length();
        int begin = 0, end = 0;
        int d = Integer.MAX_VALUE;
        int head = 0;

        for (char c: t.toCharArray()){
            charArray[c]++;
        }

        while(end < s.length()){
            if (charArray[s.charAt(end)] > 0){
                unmatchedCount--;
            }
            charArray[s.charAt(end)]--;
            end++;
            while(unmatchedCount == 0){
                //found a match
                //set d = new length if less than original d
                if (end - begin < d) {
                    head = begin;
                    d = end - begin;
                }

                if (charArray[s.charAt(begin)] == 0){
                    unmatchedCount++;
                }
                charArray[s.charAt(begin)]++;
                begin++;
            }
        }

        return d == Integer.MAX_VALUE ? "" : s.substring(head, head + d);

    }


    public static void main(String[] args) {
        Solution sol = new Solution();
        System.out.println(sol.minWindow2("ADOBECODEBANC", "ABC"));
        //System.out.println(sol.minWindow("aaaaaaaaaaaabbbbbcdd","abcdd"));

//        String input = "";
//        String t = "";
//        System.out.println(sol.minWindow(input,t));
    }


}
